const Home = () => {

    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => {
        setIsOpen(!isOpen)
    }

    return ( 
        <>
           <Sidebar isOpen={isOpen} toggle={toggle} />
           <Navbar toggle={toggle} />
           <HeroSection />
           <InfoSection {...homeObjOne} />
           <InfoSection {...homeObj} />
           <RoadmapPhase />
           <Services />
           <Footer />

        </>
     );
}

export default Home;
